CREATE TABLE Ideb(
   id_ideb       INTEGER  NOT NULL AUTO_INCREMENT PRIMARY KEY 
  ,ano           INTEGER  NOT NULL 
  ,classe        VARCHAR(2) NOT NULL
  ,indice        NUMERIC(3,1) NOT NULL
  ,meta          NUMERIC(3,1) NOT NULL
  ,atingiu_meta  BIT  NOT NULL
  ,cod_municipio INTEGER  NOT NULL
  ,FOREIGN KEY (cod_municipio) REFERENCES  Municipios(Cod_Munic)
);

